pragma solidity ^0.8.0;

contract MyContract {
    address[16] public tikets;    
    uint public balanceWei = 0;
    address payable public admin  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);
    mapping(uint => Reservation) public reservations;
    struct Reservation {
        address reserver;
        uint timestamp;
    }

    constructor() {
        for (uint i = 0; i < 16; i++) {
            reservations[i] = Reservation(address(0), 0);
        }
    }

    function changeAdmin (address payable newAdmin) public {
        require(msg.sender == admin, "You are not the admin");

        admin = payable(newAdmin);
    }

    function transferbalanceToAdmin () public {
        require(msg.sender == admin, "You are not the admin");
        
        admin.transfer(balanceWei);
        balanceWei = 0;
    }

    function isTicketAvailable (uint tiketIndex) public returns (bool) {
        // Comprobacin
        require(tikets[tiketIndex] == address(0), "No this ticket is from other person");

        return true;        
    }

    function bookTicket(uint tiketIndex) public {
        require(tikets[tiketIndex] == address(0), "Ticket already bought");
        require(reservations[tiketIndex].reserver == address(0), "Ticket already reserved");

        reservations[tiketIndex] = Reservation(msg.sender, block.timestamp);
    }

    function checkReservationTimeout(uint tiketIndex) public {
        if (block.timestamp - reservations[tiketIndex].timestamp > 120 && reservations[tiketIndex].timestamp != 0) {
            reservations[tiketIndex] = Reservation(address(0), 0);
        }
    }

    function buyTiket(uint tiketIndex) payable public returns (bool) {
        // Comprobacin
        require(tiketIndex >= 0 && tiketIndex <= 15, "This ticket can't be bought");
        require(tikets[tiketIndex] == address(0), "No this ticket is from other person");
        require(msg.value >= 0.01 ether, "Insuficient amount of BNB");

        // Verificar si hay una reserva
        if (reservations[tiketIndex].reserver != address(0) && block.timestamp - reservations[tiketIndex].timestamp <= 120) {
            // Comprobacin propietario reserva
            require(reservations[tiketIndex].reserver == msg.sender, "Ticket reserved by another person");
        }

        tikets[tiketIndex] = msg.sender;
        balanceWei += msg.value;
        reservations[tiketIndex] = Reservation(address(0), 0);

        return true;
    }

    function transferTicket(uint ticketIndex, address newOwner) public {
        require(ticketIndex >= 0 && ticketIndex <= 15, "Invalid ticket index");
        require(tikets[ticketIndex] == msg.sender, "You are not the owner of the ticket");

        tikets[ticketIndex] = newOwner;
    }

    function getTikets() public view returns (address[16] memory) {
        return tikets;
    }

    function getContractBalances() public view returns (uint, uint) {
        return (address(this).balance, balanceWei);
    }
    
    function getReservation(uint tiketIndex) public view returns (Reservation memory) {
        return reservations[tiketIndex];
    }
}
